const CATEGORIES = [
    { id: 1, name: 'Cameras', icon: 'camera' },
    { id: 2, name: 'Monitors', icon: 'monitor' },
    { id: 3, name: 'Printers', icon: 'printer' },
    { id: 4, name: 'Scanners', icon: 'scanner' },
    { id: 5, name: 'Laptops', icon: 'laptop' },
    { id: 7, name: 'Tablets', icon: 'tablet' },
    { id: 8, name: 'Mobiles', icon: 'phone' },
    { id: 10, name: 'Headphones', icon: 'headphones' },
];

export function getCategories() {
    return CATEGORIES;
}
